function toggleTab(e){const t=e.closest(".js-tabs"),n=t.find(" > .tabs__body > .tab").eq(e.parent().index());e.parent().addClass("current").siblings().removeClass("current"),n.show().siblings().hide()}$(".js-tabs > .tabs__head .tabs__nav a").on("click",function(e){e.preventDefault(),toggleTab($(this))});function fetchJsonString(e){return new Promise((t,n)=>{$.ajax({url:e,dataType:"text",success:function(e){try{const n=JSON.stringify(e);t(n)}catch(e){n(new Error("Failed to stringify data: "+e.message))}},error:function(e){n(new Error(`Error ${e.status}: ${e.statusText}`))}})})}fetchJsonString("/js/helloWorld.js").then(e=>{$("code").eq(0).text(e)}).catch(e=>{console.error(e)})